INSERT INTO `cache_filter` VALUES ('1:bcfc61b8f0e9ca3e1646762fd808e11f','<p>Emergency sirens sounded late on Saturday to alert residents, and evacuations of low-lying areas were ordered.</p>\n<p>The first waves were reported to be up to 2.5ft (76cm) in one area.</p>\n<p>Wave heights of three to six feet were predicted in some areas, as \"urgent action\" was advised to protect lives.</p>\n<p>There were no immediate reports of damage on the Canadian coast following the earthquake.</p>\n<p>Tsunami alerts that were issued for coastal areas of Alaska and British Columbia were swiftly downgraded.</p>\n',1351517943,1351431543,'',0),('1:c8bea584d60d685bce28bcb34668e07b','<p>Emergency sirens sounded late on Saturday to alert residents, and evacuations of low-lying areas were ordered.</p>\n<p>The first waves were reported to be up to 2.5ft (76cm) in one area.</p>\n<p>Wave heights of three to six feet were predicted in some areas, as \"urgent action\" was advised to protect lives.</p>\n<p>There were no immediate reports of damage on the Canadian coast following the earthquake.</p>\n<p>Tsunami alerts that were issued for coastal areas of Alaska and British Columbia were swiftly downgraded.</p>\n<p>The quake hit 125 miles (200km) south-west of the Canadian mining town of Prince Rupert at a depth of 11 miles (18km)</p>\n',1351517943,1351431543,'',0),('1:60f6610347a56a356a3ab47509841ff5','<p>Zlatan Ibrahimovic voltou a ser decisivo para o Paris Saint-Germain. Em Nancy, marcou o golo solitrio da vitria da equipa da capital,  passagem do minuto 74.</p>\n<p>Com uma barreira de quatro adversrios pela frente, o avanado sueco contornou um a um, ainda tentou servir Mnez na direita mas acabou por optar por visar a baliza, disparando um tiro com o p esquerdo. </p>\n<p>E em boa hora o fez...<br />\n10:51 - 28-10-2012</p>\n',1351518058,1351431658,'',0);
