fe6e7b1da76a','a:40:{s:7:\"#prefix\";s:1712:\"<div class=\"preview\"><h3>Preview trimmed version</h3><div id=\"node-\" class=\"node\">\n\n\n  <h2><a href=\"/node/\" title=\"TESTE\">TESTE</a></h2>\n\n  \n  <div class=\"content clear-block\">\n    <p>Emergency sirens sounded late on Saturday to alert residents, and evacuations of low-lying areas were ordered.</p>\n<p>The first waves were reported to be up to 2.5ft (76cm) in one area.</p>\n<p>Wave heights of three to six feet were predicted in some areas, as \"urgent action\" was advised to protect lives.</p>\n<p>There were no immediate reports of damage on the Canadian coast following the earthquake.</p>\n<p>Tsunami alerts that were issued for coastal areas of Alaska and British Columbia were swiftly downgraded.</p>\n  </div>\n\n  <div class=\"clear-block\">\n    <div class=\"meta\">\n        </div>\n\n      </div>\n\n</div>\n<h3>Preview full version</h3><div id=\"node-\" class=\"node\">\n\n\n  <h2><a href=\"/node/\" title=\"TESTE\">TESTE</a></h2>\n\n  \n  <div class=\"content clear-block\">\n    <p>Emergency sirens sounded late on Saturday to alert residents, and evacuations of low-lying areas were ordered.</p>\n<p>The first waves were reported to be up to 2.5ft (76cm) in one area.</p>\n<p>Wave heights of three to six feet were predicted in some areas, as \"urgent action\" was advised to protect lives.</p>\n<p>There were no immediate reports of damage on the Canadian coast following the earthquake.</p>\n<p>Tsunami alerts that were issued for coastal areas of Alaska and British Columbia were swiftly downgraded.</p>\n<p>The quake hit 125 miles (200km) south-west of the Canadian mining town of Prince Rupert at a depth of 11 miles (18km)</p>\n  </div>\n\n  <div class=\"clear-block\">\n    <div class=\"meta\">\n        </div>\n\n      </div>\n\n</div>\n</div>\n\";s:3:\"#id\";s:9:\"node-form\";s:3:\"nid\";a:2:{s:5:\"#type\";s:5:\"value\";s:6:\"#value\";N;}s:3:\"vid\";a:2:{s:5:\"#type\";s:5:\"value\";s:6:\"#value\";N;}s:3:\