INSERT INTO `node_revisions` VALUES (1,1,1,'Ibrahimovic baila antes de `fuzilar as redes (com vdeo)','Zlatan Ibrahimovic voltou a ser decisivo para o Paris Saint-Germain. Em Nancy, marcou o golo solitrio da vitria da equipa da capital,  passagem do minuto 74.\r\n\r\nCom uma barreira de quatro adversrios pela frente, o avanado sueco contornou um a um, ainda tentou servir Mnez na direita mas acabou por optar por visar a baliza, disparando um tiro com o p esquerdo. \r\n\r\nE em boa hora o fez...\r\n10:51 - 28-10-2012\r\n','Zlatan Ibrahimovic voltou a ser decisivo para o Paris Saint-Germain. Em Nancy, marcou o golo solitrio da vitria da equipa da capital,  passagem do minuto 74.\r\n\r\nCom uma barreira de quatro adversrios pela frente, o avanado sueco contornou um a um, ainda tentou servir Mnez na direita mas acabou por optar por visar a baliza, disparando um tiro com o p esquerdo. \r\n\r\nE em boa hora o fez...\r\n10:51 - 28-10-2012\r\n','',1351435502,1);
